import React, { useState } from 'react';

import Logon from './pages/Logon';

function App() {
  const [count, setCount] = useState(0);

  function aumenta() {
    setCount(count + 1);
  }

  return (
    <div>
      <Header>Contador: {count}</Header>
      <button onClick={aumenta}>+1</button>
    </div>
  );
}

export default App;
